import React from "react";
import { Form, FormGroup, Row, Col, Container } from 'reactstrap';
import { FormControl, InputLabel, Select, MenuItem, Unstable_TrapFocus } from "@material-ui/core";
import MenuSuperior from "../menuSuperior/MenuSuperior";
import PropTypes from 'prop-types';
import clsx from 'clsx';
import { TextField, Button } from "@material-ui/core";
import { withStyles, makeStyles, lighten } from '@material-ui/core/styles';

import { MDBInput, MDBTable, MDBTableBody, MDBTableHead } from 'mdbreact';

const data_checkboxes = {
    columns: [
        {
            'label': 'Check',
            'field': 'check',
            'sort': 'asc'
        },
        {
            'label': 'Lorem',
            'field': 'lorem',
            'sort': 'asc'
        },
        {
            'label': 'Ipusm',
            'field': 'ipsum',
            'sort': 'asc'
        },
        {
            'label': 'Dolor',
            'field': 'dolor',
            'sort': 'asc'
        }
    ],
    rows: [
        {
            'check': <MDBInput label="Check 2" type="checkbox" id="checkbox2" />,
            'lorem': 'Cell1',
            'ipsum': 'Cell2',
            'dolor': 'Cell3'
        },
    ]
};

const CssTextField = withStyles({
    root: {
        "& label.Mui-focused": {
            color: "black"
        },
        "& label": {
            color: "black"
        },
        "& .MuiInput-underline:before": {
            borderBottomColor: "black"
        },
        "& .MuiInput-underline:after": {
            borderBottomColor: "black"
        },
        "& .MuiOutlinedInput-root": {
            "& fieldset": {
                borderColor: "black"
            },
            "&:hover fieldset": {
                borderColor: "black"
            },
            "&.Mui-focused fieldset": {
                borderColor: "black"
            }
        }
    }
})(TextField);



const checkpromo = (props) => {
    return (
        <div>
            <MenuSuperior />
            <div>
                <Container>
                    <Row>
                        <Form>
                            <Col sm="12" md={{ size: 6, offset: 8 }} >
                                <FormGroup >

                                    <Select
                                        labelId="select-label"
                                        id="select"
                                        label="Tipos de Códigos"
                                    >
                                        <MenuItem selected disabled value="">Selecione Opção</MenuItem>
                                        <MenuItem value=""></MenuItem>
                                        <MenuItem value=""></MenuItem>
                                        <MenuItem value=""></MenuItem>
                                    </Select>
                                </FormGroup>
                            </Col>
                        </Form>
                        <Col  sm="12" md={{ size: 6, offset: 8 }}>
                            <MDBTable btn fixed>
                                <MDBTableHead columns={data_checkboxes.columns} />
                                <MDBTableBody rows={data_checkboxes.rows} />
                            </MDBTable>
                        </Col>
                    </Row>
                </Container>
            </div>
            <div >
                <Col xl={6}>
                    <Container className="container-theme" fluid={true}>
                        <Form >
                            <Row>
                                <Col sm={12} md={4} lg={4} xl={4}>

                                    <FormGroup>
                                        <TextField
                                            id="standard-multiline-flexible"
                                            label="De:"
                                            multiline
                                            maxRows={4}
                                            value=""
                                        />
                                    </FormGroup>
                                </Col>
                                <Col sm={12} md={4} lg={4} xl={4}>
                                    <FormGroup>
                                        <TextField
                                            id="standard-multiline-flexible"
                                            label="Até:"
                                            multiline
                                            maxRows={4}
                                            value=""
                                        />
                                    </FormGroup>
                                </Col>
                            </Row>
                        </Form>
                        <Form>
                            <Row>
                                <Col sm={12} md={4} lg={4} xl={4} >
                                    <FormGroup >
                                        <InputLabel id="select-label">Buscar</InputLabel>
                                        <Select
                                            labelId="select-label"
                                            id="select"
                                            label="Buscar"
                                        >
                                            <MenuItem selected disabled value="">Selecione uma Opção de Consulta</MenuItem>
                                            <MenuItem value=""></MenuItem>
                                            <MenuItem value=""></MenuItem>
                                            <MenuItem value=""></MenuItem>
                                        </Select>
                                    </FormGroup>
                                </Col>
                                <Col sm={12}>
                                    <Button style={{ background: "#007bff", color: "#fff", borderRadius: "0%" }}>Filtrar</Button>{' '}
                                </Col>
                            </Row>
                        </Form>
                    </Container>
                </Col>
            </div>

        </div>
    );
}
export default checkpromo;
